import ProjectCard from "./ProjectCard";
import ProjectData from "./ProjectData";

const Projects = () => {
    return (
        <>
            <div className="main-projects">
                <div className="heading">
                    <h1>Projects</h1>
                </div>
                {
                    ProjectData.map((val, ind) => <ProjectCard
                        id={ind}
                        Title={val.title}
                        link={val.link}
                    />)
                }
            </div>
        </>
    );
}

export default Projects;
